import { Top } from "../components/pages/Top";

export const homeRoutes = [
  {
    path: "/",
    exact: true,
    children: <Top />,
  },
  {
    path: "/request",
    exact: true,
    children: <Top />,
  },
  {
    path: "/new",
    exact: true,
    children: <Top />,
  },
  {
    path: "/request/list",
    exact: true,
    children: <Top />,
  },
];
